To celebrate the launch of our upcoming collaboration with ASICS, we looked to New York City’s vibrant creative community, to highlight select individuals who bring a unique approach to their craft; pushing boundaries in ways that extend beyond their disciplines and surroundings, contributing to the city’s ever-evolving cultural landscape.

Co-founder of New York-based furniture store Lichen, Jared Blake has built a foundation at the intersection of home goods and streetwear culture, creating a space for accessible, high-quality design. Rooted in empathy and craftsmanship, and deeply connected to NYC’s creative pulse, Lichen reflects the city’s relentless energy while shaping its evolving design identity.

Discover the full interview with Jared through the link in our bio.
@jaredtblake_ 
@asics_sportstyle 

