To celebrate the launch of our upcoming collaboration with ASICS and our ongoing Field Tester iniative we looked to New York City’s vibrant creative community, to highlight select individuals who bring a unique approach to their craft; pushing boundaries in ways that extend beyond their disciplines and surroundings, contributing to the city’s ever-evolving cultural landscape.

Stylist Marcel Peña’s journey in fashion is inseparably linked to his New York roots. Inspired by the dynamic energy of the city, particularly its diverse neighborhoods and the culture of the late ‘90s and early 2000s, Marcel’s work reflects the city’s multifaceted style, striking a balance between expression and functionality.

