As part of our HAVEN Field Tester program, we turned our focus to a small group of individuals within Canada’s creative community, each embodying a unique approach to their craft. Their pursuit of excellence mirrors our own, exploring how artistry and authenticity can intersect in ways that resonate beyond our borders.

Montreal-based creative partners Dan Climan and Danny Smiles merge culinary innovation with a thoughtful approach to space and materiality at Le Violon. With Danny’s dedication to seasonal, sustainable cuisine and Dan’s evocative artwork lending the space its distinct character, their hands-on approach has set Le Violon on a course for enduring success from its inception.

